import React from "react";

function Main() {
	return (
		<div className='main'>
         <div className='cb'> 
			<input type='checkbox' name='animals' id='lion' />
			<span>Lion</span>
         </div>
		<div>
			<input type='checkbox' name='animals' id='tiger' />
			<span>Tiger</span>

      </div>
			<div>

			<input type='checkbox' name='animals' id='jaguar' />
			<span>Jaguar</span>
         </div>
		<div></div>
			<input type='checkbox' name='animals' id='cheetah' />
			<span>Cheetah</span>
		</div>
	);
}

export default Main;
